import React, { Component } from "react";
import "../css/header.css";
import Logo from "../logo.png";


class Header extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="header">
        <div className="menu">
         <p><i class="fa fa-bars" aria-hidden="true"></i>Мени</p> 
        </div>
        <div className="brainsterLogo">
          <img src={Logo} />
        </div>
        <div className="linkovi">
            <a href="https://brainster.co/" target="_blank"><button className="obukiKopce">Обуки за компании</button></a>
            <a href="https://brainster.co/" target="_blank"><button className="vrabotiKopce">Вработи наши студенти</button></a>
        </div>
      </div>
    );
  }
}

export default Header;
